                },
                options: {
                    responsive: true,
                    legend: {
                        position: 'bottom',
                    },
                    hover: {
                        mode: 'label'
                    },
                    scales: {
                        xAxes: [{
                            display: true,
                            scaleLabel: {
                                display: false,
                                labelString: 'Fecha/hora'
                            }
                        }],
                        yAxes: [{
                            display: true,
                            ticks: {
                                min: low,
                                max: top
                            }
                       ");
                WriteLiteral(@" }]
                    },
                    title: {
